import "./table.css"

const viewWorkerTable = () => {
    return(
        <div className="App">
        <table>
            <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>CNIC</th>
            <th>Work</th>
            <th>Contact</th>
            <th>Salary</th>
            <th>Description</th>
            </tr>
            {data.map((val, key) => {
            return (
                <tr key={key}>
                <td>{val.name}</td>
                <td>{val.age}</td>
                <td>{val.gender}</td>
                </tr>
            )
            })}
        </table>
        </div>
    )
}

export default viewWorkerTable;
